import Button from "../components/Button";
import Header from "../components/Header";
import { useNavigate } from "react-router-dom";

const Result = () => {
    const navigate = useNavigate();
    const doAgain = () => {
        navigate(`/`);
    }
    return(
        <div>
            <Header
                title="result page"
            />
            <Button text="공유하기"/>
            <Button text="다시하기" onClick={doAgain}/>
        </div>
    )
}

export default Result;
